import React, { Component } from "react";

// map
import { Map as LeafletMap, TileLayer, Marker, Popup } from 'react-leaflet';

class Piece_of_Ground_Map extends Component {

	// constructor
	constructor(props) {

		// constructur of parent
		super(props);

		// initial states
		this.state = {

			// num_loteos: null,
			// num_pieces_ground: 39,
			// flag of get data from server
			get_loteos: false,
			// markers (each place is a list of 2 elements)
			// marker: [latitude, longitude]
			// loteos: null,

		}

	}

	// render method
	render() {

		return (

			<div className="container">

				<div style={{ height: '100vh', width: '100%' }}>

					{this.state.get_loteos 

						? 


							<LeafletMap
						        center={[-39.838000, -73.236481]}
						        zoom={13}
						        maxZoom={100}
						        attributionControl={true}
						        zoomControl={true}
						        doubleClickZoom={true}
						        scrollWheelZoom={true}
						        dragging={true}
						        animate={true}
						        easeLinearity={0.35}
						      >
						        <TileLayer
						          url='http://{s}.tile.osm.org/{z}/{x}/{y}.png'
						        />



						        {this.state.loteos.map( (loteo, idx) => 

						        	<Marker key = {idx} position = {loteo.location}>

						        	  <Popup>

						        	  	ajsioasj

						        	  </Popup>

						        	</Marker>

						        )}


						    </LeafletMap>

				    	:

				    		<div> Loading </div>

			    	}

				</div>

		  	</div>

		);

	}

}

export default Piece_of_Ground_Map;
